key = b'\xab\xec\xe9<\xaaC\x7fr\xeb\x8dgQ\xc0\x94\x01\x1d\xc03\x14\x97\xe2\x91\x97\xcf\x8b\x13?\x1d24w|'
#ct = conv(plain1,key)
ct = bytes.fromhex("")
def conv(array1:bytes, array2:bytes) -> bytes:
    len1, len2 = len(array1), len(array2)
    # len1 = 366
    # len2 = 32
    res = [0]*(len1 + len2 - 1)
    for i in range(len1 + len2 - 1):
        csum = 0
        for j in range(max(0, i - len2 + 1), min(len1, i + 1)):
            csum += array1[j] * array2[i - j]
        res[i] = csum % 256
    return res
plain1_len = len(ct)-len(key)+1
plain1=[0]*plain1_len
for i in range(32, 128):
    if key[0]* i %256 == ct[0]:
        plain1[0]=i

def solve():
    len1 = 366
    len2 = 32
    for i in range(1, len1 + len2 - 1):
        csum = ct[i]
        ok = min(len1, i + 1)
        for j in range(max(0, i - len2 + 1), ok):
            if j == ok - 1:
                for k in range(32, 128):
                    if (key[i-j]* k )%256 == csum:
                        plain1[j]=k
            csum -= plain1[j] * key[i - j]
            csum %= 256
solve()
